export default function CheckoutForm({ paymentMethod }) {
  console.log(paymentMethod);
  if (paymentMethod === "Cash") {
    return (
      <>
        <p>cash</p>
      </>
    );
  }
  if (paymentMethod === "Gopay") {
    return (
      <>
        <p>Gopay</p>
      </>
    );
  }
  if (paymentMethod === "Paylater") {
    return (
      <>
        <p>Paylater</p>
      </>
    );
  } else {
    <>
      <p>Seems something went wrong. try again later</p>
    </>;
  }
}
